DROP TABLE IF EXISTS `armor`;
CREATE TABLE `armor` (
  `item_id` smallint(4) NOT NULL default '0',
  `name` varchar(128) NOT NULL default '',
  `additional_name` varchar(128) NOT NULL default '',
  `bodypart` varchar(16) NOT NULL default '',
  `crystallizable` enum('false','true') NOT NULL default 'false',
  `armor_type` varchar(12) NOT NULL default '',
  `player_class` enum('Bard','BowMaster','DaggerMaster','Enchanter','ForceMaster','Healer','ShieldMaster','Summoner','WeaponMaster','Wizard') default NULL,
  `weight` int(11) NOT NULL default '0',
  `crystal_type` enum('none','d','c','b','a','s','s80','s84') NOT NULL default 'none',
  `avoid_modify` int(11) NOT NULL default '0',
  `durability` int(11) NOT NULL default '-1',
  `temporal` tinyint(1) unsigned NOT NULL default '0',
  `p_def` int(11) NOT NULL default '0',
  `m_def` int(11) NOT NULL default '0',
  `mp_bonus` int(11) NOT NULL default '0',
  `price` int(11) NOT NULL default '0',
  `crystal_count` int(11) NOT NULL default '0',
  `sellable` enum('false','true') NOT NULL default 'true',
  `icon` varchar(128) NOT NULL default '',
  `dropable` tinyint(1) NOT NULL default '1',
  `destroyable` tinyint(1) NOT NULL default '1',
  `tradeable` tinyint(1) NOT NULL default '1',
  `skill_id` varchar(50) NOT NULL default '0',
  `skill_level` varchar(30) NOT NULL default '0',
  `enchant4_skill_id` smallint(4) NOT NULL default '0',
  `enchant4_skill_lvl` smallint(4) NOT NULL default '0',
  PRIMARY KEY  (`item_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


ALTER TABLE `armor`  ADD COLUMN `flags` INT(10) UNSIGNED NOT NULL DEFAULT '0' AFTER `tradeable`;
UPDATE `armor` SET `flags`='16' WHERE `item_id` IN (13293,13294,13295,13296);